import React from "react";
import "./create.css";

const Create = () => {
  return (
    <div className="container">
      <h1>Create an NFT</h1>
      <form>
        <input type={Text} placeholder="Title" />
        <input type={Text} placeholder="Price" />
        <input type={Text} id="description" placeholder="Description" />

      </form>
    </div>
  );
};

export default Create;
